import React from "react";
import ReactDOM from "react-dom";
import "./Square.css";
import "./Board.css";

class Square extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return <div>{this.props.squareNum}</div>;
  }
}
export class Board extends React.Component {
  render() {
    return (
      <div className="bigboard">
        <div className="row">
          <Square squareNum={1} />
          <Square squareNum={2} />
          <Square squareNum={3} />
        </div>
        <div className="row">
          <Square squareNum={4} />
          <Square squareNum={5} />
          <Square squareNum={6} />
        </div>
        <div className="row">
          <Square squareNum={7} />
          <Square squareNum={8} />
          <Square squareNum={9} />
        </div>
      </div>
    );
  }
}
